import React, { Component } from 'react'

export default class ToDoForm extends Component {
  constructor(){
    super()
    this.state = {
      priority: "",
      description: "",
      completed: false
    }
  }

  render(){
    return(
      <form>
        <input type="text" placeholder= "description" />
      </form>
    )
  }
}
